CREATE TABLE pokemon (
  id INT PRIMARY KEY NOT NULL AUTO_INCREMENT,
  pokemonName VARCHAR(255) NOT NULL,
  pokemonUrl VARCHAR(255) NOT NULL,
  experience INT NOT NULL,
  heigth INT NOT NULL,
  hp INT NOT NULL,
  attack INT NOT NULL,
  defense INT NOT NULL,
  specialAttack INT NOT NULL,
  specialDefense INT NOT NULL,
  speed INT NOT NULL,
  pokemonWeight INT NOT NULL,
  primaryType VARCHAR(255) NOT NULL,
  secondaryType VARCHAR(255) NULL,
  pokemonPrice INT NOT NULL,
  firstAbility VARCHAR(255) NOT NULL,
  secondAbility VARCHAR(255),
  firstMove VARCHAR(255) NOT NULL,
  secondMove VARCHAR(255) NOT NULL,
  thirdMove VARCHAR(255) NOT NULL,
  fourthMove VARCHAR(255) NOT NULL
) 
ENGINE=InnoDB DEFAULT CHARSET=utf8;



  


